-- 行政区划字典版本兼容问题

-- 增加版本号，五笔码改为必填
ALTER TABLE `his`.`dic_xzqh`
    ADD COLUMN `VERSION` varchar(10) NULL COMMENT '版本号' AFTER `WB_CODE`,
    MODIFY COLUMN `WB_CODE` varchar(100) NULL COMMENT '五笔码' AFTER `PY_CODE`;

-- 目前版本的数据增加默认版本号
UPDATE `his`.`dic_xzqh` SET VERSION = '1.0' WHERE VERSION IS NULL;

